INSERT INTO `lb_policy` VALUES ('4', '服务中心接单指南', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;服务中心，如须接单，必须具备直属子帐号或附属子帐号&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;1、具备子属帐号。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;2、在PC端前台【http://lianbao.cdth.cn/】登陆。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;3、在【我的订单】-【待指派】可查看待接工单。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;4、在对应工单的行的【指派师傅】经选择师傅（子属帐号）后，才算接单成功。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;5、同时，将会推送信息给对应的师傅（子属帐号）处。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;6、师傅（子属帐号）所用的APP4.0，除无【抢单区】外，其功能与基本与普通会员一致。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;7、PC端现暂无完结功能，但有【催单】，【退单】，【求助】，【改派】，【获取验证码】，【提现】等功能。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; line-height: 40px; font-size: 14px; color: rgb(51, 51, 51); padding: 0px 10px; box-sizing: border-box; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;8、工单的最终完结，只能通过APP端才能操作。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '服务中心接单指南', '1467169693', '1', '2');
INSERT INTO `lb_policy` VALUES ('5', '生成子账号操作指南', '&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;; line-height: 2;&quot;&gt;服务中心，如须接单，必须具备直属子帐号或附属子帐号&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;1.以普通会员注册成功&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;2.在【会员中心】-【申请为企业成员】，选择帐号类型：附属成员或直属成员。&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;&amp;nbsp; &amp;nbsp;直属成员：特指隶属公司内部员工。&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;&amp;nbsp; &amp;nbsp;附属成员：特指加盟公司的合作售后商或师傅。&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;; line-height: 2;&quot;&gt;3&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;; line-height: 2;&quot;&gt;、选择企业：&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;; line-height: 2;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;仅显示与申请方属同一地级市的所有服务中心。&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;4.待主帐号同意后就可生效（在PC端操作）&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; color: rgb(229, 51, 51); font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;5.注意：普通会员如有未完工单，无法申请成为企业成员&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;blockquote style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; margin-left: 0cm; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;line-height: 2; color: rgb(229, 51, 51); font-size: 14px; font-family: &amp;#39;Microsoft YaHei&amp;#39;;&quot;&gt;6、企业成员APP端无“抢单区”，只接服务中心下派的工单。&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;/blockquote&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '生成子账号操作指南', '1467172441', '2', '2');
INSERT INTO `lb_policy` VALUES ('9', '服务质量管理规章', '&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 28px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;一、&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;服务态度&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;:&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;1.&amp;nbsp; 上门服务人员语言不规范、态度恶劣、与用户争吵、肢体冲突；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚100元&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;上门服务过程中在用户家中抽烟、收取礼物；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚100元&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;未按预约时间上门造成用户投诉；形象店未按规定时间预约的；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚50元&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;4.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;接单后不联系用户，不上门服务而造成的甩单；VIP会员拒绝接单；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚50元&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;5.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;接单后，未按规定提前与用户联系，造成用户催单后仍未与用户沟通，产生二次以上催单；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚50元&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;6.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;受理用户投诉后，在有条件解决问题的基础上，经电话或书面通知后仍不配合解决的；承担工单产生的所有费用，&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;并扣100元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;7.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;向用户发表损害品牌厂商形象的言论或诋毁产品质量造成退换货的；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;承担退换货损失，并扣100元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;8.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;因售后商服务态度与服务技能原因导致用户在京东、天猫等电商平台差评的（售后商积极配合处理用户不满的不处罚）&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚100元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;二、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;服务流程:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;1.&amp;nbsp;&amp;nbsp; 因安装、维修服务或技术原因造成用户退换货的；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;承担退换货损失&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;2.&amp;nbsp;&amp;nbsp; 因技术技能能力差，维修时间长或无法判断故障原因，且不及时反馈信息不寻求帮助，导致用户投诉；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚50元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;3.&amp;nbsp;&amp;nbsp; 安装维修燃气热水器时，未按要求安装排烟管或不安装排烟管导致的事故；安装即热式热水器，因安装环境达不到要求，强行安装导致的责任事；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;承担全部的事故责任&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;4.&amp;nbsp;&amp;nbsp; 在上门服务中向用户乱收费（不按照大、中、小修类别收费，辅助材料不按标准收费）；退还多收费用，双倍扣罚多收费用&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;5.&amp;nbsp;&amp;nbsp; 未经用户同意擅自改约或约定上门时间而未上门；扣罚20元&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;6.&amp;nbsp;&amp;nbsp; 更换旧配件或不标准的配件导致用户的投诉；重新免费更换配件，并扣50元/次&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;7.&amp;nbsp;&amp;nbsp; 旧配件未在15日内返还厂商或中国联保；双倍扣罚配件成本&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;8.&amp;nbsp;&amp;nbsp; 收费后不出示收费标准或收费不开具票据凭证；50元/次&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;9.&amp;nbsp;&amp;nbsp; 产品未经过鉴定以无配件为由拒绝上门服务；50元/次&lt;/span&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 30px&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;三、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;消协媒体投诉&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;1． 因处理用户不当或处理不及时，造成电视台、报纸或网络媒体曝光；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;扣罚500元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;blockquote style=&quot;padding: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-indent: 2em;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p class=&quot;MsoListParagraph&quot; style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 52px&quot;&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;2． 因处理用户不当，导致用户投诉到消协、技术监督局、网站、论坛中发帖子投诉的；&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;;font-size: 14px;line-height: 2&quot;&gt;罚扣200元/次&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;/blockquote&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '服务质量管理规章', '1467173153', '3', '2');
INSERT INTO `lb_policy` VALUES ('8', '工单完结必读', '&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 0;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;text-indent: 0;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;&lt;span style=&quot;color: rgb(229, 51, 51);font-size: 16px&quot;&gt;为保证华帝&lt;/span&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;燃气热水器安装完毕后，能顺利结算，请各售后商朋友&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 0;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;text-indent: 0;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;仔细阅读此要求，否则，将有可能无法正常结算。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 0;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;text-indent: 0;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;一、燃气热水器安装完毕&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 51, 153);font-size: 16px&quot;&gt;时，需提供：&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;&amp;nbsp; 1）、机器整机的正面照片（水气管连接完善）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;&amp;nbsp; 2）、侧面机器的序列号照片 （清晰的型号和条码完整）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;&amp;nbsp; 3）、排烟管照片（切勿使用铝质伸宿烟管）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px;color: rgb(0, 51, 153)&quot;&gt;服务完成，只有提供以上三种照片，才能结算费用。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;具体三张照片如下：&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;(&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;标准的图片格式）&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;1.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;整机安装图：如下&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20150820/20150820134213_54712.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;color: rgb(229, 51, 51);font-size: 16px&quot;&gt;要点：水气管路需要连接完毕.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;烟管走向：如下&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20150820/20150820134318_62613.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;要点：需要看到从机器到出墙体外的整体照片&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;（烟管需要通墙外&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;、烟管需要连接机器）&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;机器上的出厂编号：如下&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 24px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 14px&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20150820/20150820134439_24865.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&amp;nbsp;&lt;span style=&quot;line-height: 1.5&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color: rgb(229, 51, 51);font-size: 16px&quot;&gt;要点：照片需要有型号+出厂编号+合格证标签，三者齐全才可结单。安装前提前拍照&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;line-height: 1.5&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color: rgb(229, 51, 51);font-size: 16px&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;line-height: 1.5&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;text-align: center;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;strong&gt;华帝热水器安装拍照制度&lt;/strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;strong&gt;一、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;strong&gt;拍照要求&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;1、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 正面拍照&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145339_30137.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;2、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 烟管拍照要求&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145352_99714.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;3、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 侧面拍照&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145400_66034.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;4、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 安装位置及拍照要求&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145408_98445.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;5、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 防冻标示粘贴及拍照要求&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145419_50066.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;6、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 安装规范演示及拍照要求&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;img src=&quot;http://four.cug2313.com/Uploads/KindEditor/image/20160405/20160405145432_54145.jpg&quot; alt=&quot;&quot; style=&quot;border: none&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px&quot;&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;strong&gt;二、&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;strong&gt;拍照返单规定&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 48px&quot;&gt;1、热水器安装调试后拍照，拍照合格结算此单；&lt;/p&gt;2、热水器不拍照或是拍照不合格将计入考核项，作为维修商考核项指标，每月统计月考核。&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '工单完结必读', '1467173055', '4', '2');
INSERT INTO `lb_policy` VALUES ('7', '工单注意事项', '&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; white-space: normal; text-align: center; background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;工单及配件单管理&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;margin-left: 0;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;text-indent: 0;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;1、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;为了避免超期工单，需要注意时间节点：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;当天&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;17&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;点前，创建的单据需在当天&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;18&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;点前预约具体的上门时间&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;当天&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;17&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;点后，创建的单据需在次日&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;12&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;点前预约具体的上门时间&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;从预约时间算起，&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;24&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;小时内需上门安装&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;/&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;维修，若服务超期，罚款&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;10&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;元&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;/&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;单&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;2、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;远程费用申请：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;单程&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;15&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;公里之内，不可申请&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;单程&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;15&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;公里之外，&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;1.5&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;元&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;/&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;公里&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;每单远程最高不超出&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;100&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;3、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;服务完成：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif; white-space: normal; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;必须提供，厂家所需要的照片，工单信息没有注明需要的产品照片可以不用上传&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;4、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;工单质量要求：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;维修工单：&lt;/span&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;90&lt;/span&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;天内，重复维修同一台机器的同一个故障，则需免费检测维修&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;安装工单：&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;30&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;天内，因安装原因造成返修的单据，则需免费检测维修或调试&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;5、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;配件申请需提供：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;配件图片&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;+&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;机器型号图片。&lt;/span&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;6、&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;color: rgb(229, 51, 51)&quot;&gt;配件返厂：&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px&quot;&gt;&amp;nbsp; 凡是换配件的工单注意工单留言信息，查看返件地址&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px;margin-top: 0px;margin-bottom: 0px;font-family: &amp;#39;Microsoft YaHei&amp;#39;, 微软雅黑, Arial, Helvetica, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&amp;nbsp; 厂家要求返件的工单必须返件，10天内不返件的工单不在结算&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '工单注意事项', '1467172890', '5', '2');
INSERT INTO `lb_policy` VALUES ('18', '用户协议', '&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;一、总则&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;1．1　用户应当同意本协议的条款并按照页面上的提示完成全部的注册程序。用户在进行注册程序过程中点击&amp;quot;同意&amp;quot;按钮即表示用户与百度公司达成协议，完全接受本协议项下的全部条款。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1．2　用户注册成功后，百度将给予每个用户一个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户应当对以其用户帐号进行的所有活动和事件负法律责任。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1．3　用户可以使用百度各个频道单项服务，当用户使用百度各单项服务时，用户的使用行为视为其对该单项服务的服务条款以及百度在该单项服务中发出的各类公告的同意。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1．4　百度会员服务协议以及各个频道单项服务条款和公告可由百度公司随时更新，且无需另行通知。您在使用相关服务时,应关注并遵守其所适用的相关条款。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em;&quot;&gt;您在使用百度提供的各项服务之前，应仔细阅读本服务协议。如您不同意本服务协议及/或随时对其的修改，您可以主动取消百度提供的服务；您一旦使用百度服务，即视为您已了解并完全同意本服务协议各项内容，包括百度对服务协议随时所做的任何修改，并成为百度用户。&lt;/p&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;二、注册信息和隐私保护&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;2．1　百度帐号（即百度用户ID）的所有权归百度，用户完成注册申请手续后，获得百度帐号的使用权。用户应提供及时、详尽及准确的个人资料，并不断更新注册资料，符合及时、详尽准确的要求。所有原始键入的资料将引用为注册资料。如果因注册信息不真实而引起的问题，并对问题发生所带来的后果，百度不负任何责任。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2．2　用户不应将其帐号、密码转让、出售或出借予他人使用，如果百度发现使用者并非帐号注册者本人，百度有权停止继续服务。如用户发现其帐号遭他人非法使用，应立即通知百度。因黑客行为或用户违反本协议规定导致帐号、密码遭他人非法使用的，由用户本人承担因此导致的损失和一切法律责任，百度不承担任何责任。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2．3　百度的&lt;a href=&quot;http://www.baidu.com/duty/yinsiquan.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 204);&quot;&gt;隐私权保护声明&lt;/a&gt;说明了百度如何收集和使用用户信息。您保证已经充分了解并同意百度可以据此处理用户信息。请点击链接查看：&lt;a href=&quot;http://www.baidu.com/duty/yinsiquan.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 204);&quot;&gt;http://www.baidu.com/duty/yinsiquan.html&lt;/a&gt;。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;三、使用规则&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;3．1　用户在使用百度服务时，必须遵守中华人民共和国相关法律法规的规定，用户应同意将不会利用本服务进行任何违法或不正当的活动，包括但不限于下列行为∶&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（1）上载、展示、张贴、传播或以其它方式传送含有下列内容之一的信息：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1） 反对宪法所确定的基本原则的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2） 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3） 损害国家荣誉和利益的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4） 煽动民族仇恨、民族歧视、破坏民族团结的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;5） 破坏国家宗教政策，宣扬邪教和封建迷信的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;6） 散布谣言，扰乱社会秩序，破坏社会稳定的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7） 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;8） 侮辱或者诽谤他人，侵害他人合法权利的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;9） 含有虚假、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗俗、猥亵、或其它道德上令人反感的内容；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;10） 含有中国法律、法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其它内容的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（2）不得为任何非法目的而使用网络服务系统；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（3）不利用百度服务从事以下活动：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1）未经允许，进入计算机信息网络或者使用计算机信息网络资源的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2） 未经允许，对计算机信息网络功能进行删除、修改或者增加的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3） 未经允许，对进入计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4） 故意制作、传播计算机病毒等破坏性程序的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;5） 其他危害计算机信息网络安全的行为。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3．2　用户违反本协议或相关的服务条款的规定，导致或产生的任何第三方主张的任何索赔、要求或损失，包括合理的律师费，您同意赔偿百度与合作公司、关联公司，并使之免受损害。对此，百度有权视用户的行为性质，采取包括但不限于删除用户发布信息内容、暂停使用许可、终止服务、限制使用、回收百度帐号、追究法律责任等措施。对恶意注册百度帐号或利用百度帐号进行违法活动、捣乱、骚扰、欺骗、其他用户以及其他违反本协议的行为，百度有权回收其帐号。同时，百度公司会视司法部门的要求，协助调查。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3．3　用户不得对本服务任何部分或本服务之使用或获得，进行复制、拷贝、出售、转售或用于任何其它商业目的。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3．4　用户须对自己在使用百度服务过程中的行为承担法律责任。用户承担法律责任的形式包括但不限于：对受到侵害者进行赔偿，以及在百度公司首先承担了因用户行为导致的行政处罚或侵权损害赔偿责任后，用户应给予百度公司等额的赔偿。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;四、服务内容&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;4．1　百度网络服务的具体内容由百度根据实际情况提供。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．2　除非本服务协议另有其它明示规定，百度所推出的新产品、新功能、新服务，均受到本服务协议之规范。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．3　为使用本服务，您必须能够自行经有法律资格对您提供互联网接入服务的第三方，进入国际互联网，并应自行支付相关服务费用。此外，您必须自行配备及负责与国际联网连线所需之一切必要装备，包括计算机、数据机或其它存取装置。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．4　鉴于网络服务的特殊性，用户同意百度有权不经事先通知，随时变更、中断或终止部分或全部的网络服务（包括收费网络服务）。百度不担保网络服务不会中断，对网络服务的及时性、安全性、准确性也都不作担保。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．5　百度需要定期或不定期地对提供网络服务的平台或相关的设备进行检修或者维护，如因此类情况而造成网络服务（包括收费网络服务）在合理时间内的中断，百度无需为此承担任何责任。百度保留不经事先通知为维修保养、升级或其它目的暂停本服务任何部分的权利。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．6 本服务或第三人可提供与其它国际互联网上之网站或资源之链接。由于百度无法控制这些网站及资源，您了解并同意，此类网站或资源是否可供利用，百度不予负责，存在或源于此类网站或资源之任何内容、广告、产品或其它资料，百度亦不予保证或负责。因使用或依赖任何此类网站或资源发布的或经由此类网站或资源获得的任何内容、商品或服务所产生的任何损害或损失，百度不承担任何责任。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．7 用户明确同意其使用百度网络服务所存在的风险将完全由其自己承担。用户理解并接受下载或通过百度服务取得的任何信息资料取决于用户自己，并由其承担系统受损、资料丢失以及其它任何风险。百度对在服务网上得到的任何商品购物服务、交易进程、招聘信息，都不作担保。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．8 用户须知：百度提供的各种挖掘推送服务中（包括百度新首页的导航网址推送），推送给用户曾经访问过的网站或资源之链接是基于机器算法自动推出，百度不对其内容的有效性、安全性、合法性等做任何担保。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．9　6个月未登陆的帐号，百度保留关闭的权利。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．10　百度有权于任何时间暂时或永久修改或终止本服务（或其任何部分），而无论其通知与否，百度对用户和任何第三人均无需承担任何责任。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4．11　终止服务&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;您同意百度得基于其自行之考虑，因任何理由，包含但不限于长时间未使用，或百度认为您已经违反本服务协议的文字及精神，终止您的密码、帐号或本服务之使用（或服务之任何部分），并将您在本服务内任何内容加以移除并删除。您同意依本服务协议任何规定提供之本服务，无需进行事先通知即可中断或终止，您承认并同意，百度可立即关闭或删除您的帐号及您帐号中所有相关信息及文件，及/或禁止继续使用前述文件或本服务。此外，您同意若本服务之使用被中断或终止或您的帐号及相关信息和文件被关闭或删除，百度对您或任何第三人均不承担任何责任。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;五、知识产权和其他合法权益（包括但不限于名誉权、商誉权）&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;5．1　用户专属权利&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;百度尊重他人知识产权和合法权益，呼吁用户也要同样尊重知识产权和他人合法权益。若您认为您的知识产权或其他合法权益被侵犯，请按照以下说明向百度提供资料∶&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;请注意：如果权利通知的陈述失实，权利通知提交者将承担对由此造成的全部法律责任（包括但不限于赔偿各种费用及律师费）。如果上述个人或单位不确定网络上可获取的资料是否侵犯了其知识产权和其他合法权益，百度建议该个人或单位首先咨询专业人士。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;为了百度有效处理上述个人或单位的权利通知，请使用以下格式（包括各条款的序号）：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;1. 权利人对涉嫌侵权内容拥有知识产权或其他合法权益和/或依法可以行使知识产权或其他合法权益的权属证明；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;2. 请充分、明确地描述被侵犯了知识产权或其他合法权益的情况并请提供涉嫌侵权的第三方网址（如果有）。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;3. 请指明涉嫌侵权网页的哪些内容侵犯了第2项中列明的权利。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;4. 请提供权利人具体的联络信息，包括姓名、身份证或护照复印件（对自然人）、单位登记证明复印件（对单位）、通信地址、电话号码、传真和电子邮件。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;5. 请提供涉嫌侵权内容在信息网络上的位置（如指明您举报的含有侵权内容的出处，即：指网页地址或网页内的位置）以便我们与您举报的含有侵权内容的网页的所有权人/管理人联系。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;6. 请在权利通知中加入如下关于通知内容真实性的声明： “我保证，本通知中所述信息是充分、真实、准确的，如果本权利通知内容不完全属实，本人将承担由此产生的一切法律责任。”&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7. 请您签署该文件，如果您是依法成立的机构或组织，请您加盖公章。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;请您把以上资料和联络方式书面发往以下地址：　　&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;中国北京市海淀区上地十街10号百度大厦，百度公司　产品事务组，邮政编码：100085。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;5．2　对于用户通过百度服务（包括但不限于贴吧、知道、MP3、影视等）上传到百度网站上可公开获取区域的任何内容，用户同意百度在全世界范围内具有免费的、永久性的、不可撤销的、非独家的和完全再许可的权利和许可，以使用、复制、修改、改编、出版、翻译、据以创作衍生作品、传播、表演和展示此等内容（整体或部分），和/或将此等内容编入当前已知的或以后开发的其他任何形式的作品、媒体或技术中。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;5．3　百度拥有本网站内所有资料的版权。任何被授权的浏览、复制、打印和传播属于本网站内的资料必须符合以下条件：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（1） 所有的资料和图象均以获得信息为目的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（2） 所有的资料和图象均不得用于商业目的；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（3） 所有的资料、图象及其任何部分都必须包括此版权声明；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（4） 本网站（www.baidu.com）所有的产品、技术与所有程序均属于百度知识产权，在此并未授权。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（5） “Baidu”, “百度”及相关图形等为百度的注册商标。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;（6） 未经百度许可，任何人不得擅自（包括但不限于：以非法的方式复制、传播、展示、镜像、上载、下载）使用。否则，百度将依法追究法律责任。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;六、青少年用户特别提示&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;青少年用户必须遵守全国青少年网络文明公约：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;要善于网上学习，不浏览不良信息；要诚实友好交流，不侮辱欺诈他人；要增强自护意识，不随意约会网友；要维护网络安全，不破坏网络秩序；要有益身心健康，不沉溺虚拟时空。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;margin: 0px 0px 5px; padding: 0px; font-size: 12px;&quot;&gt;七、其他&lt;/h2&gt;&lt;ul style=&quot;list-style-type: none;&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;7．1　本协议的订立、执行和解释及争议的解决均应适用中华人民共和国法律。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7．2　如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向百度所在地的人民法院提起诉讼。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7．3　百度未行使或执行本服务协议任何权利或规定，不构成对前述权利或权利之放弃。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7．4　如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议的其余条款仍应有效并且有约束力。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;7．5　欢迎用户使用百付宝进行合法网络交易，请您遵守&lt;a href=&quot;http://co.baifubao.com/content/payhelp/B6/2008-12-25/123109208155.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 204);&quot;&gt;百付宝用户协议&lt;/a&gt;。&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;请您在发现任何违反本服务协议以及其他任何单项服务的服务条款、百度各类公告之情形时，通知百度。您可以通过如下联络方式同百度联系：&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;中国北京市海淀区上地十街10号百度大厦&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;百度公司　产品事务组&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;邮政编码：100085&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', null, '1472635000', '9', '2');
INSERT INTO `lb_policy` VALUES ('10', '关于全国联保', '&lt;p&gt;&lt;span style=&quot;font-family: 宋体;font-size: 24px&quot;&gt;&lt;span style=&quot;font-family:宋体&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 驰达家维&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;驰达家维全称《驰达家维科技有限公司》，简称《驰达联保》，主要售后维修各类家用电器产品，公司总部四川省成都市高新区环球中心。公司服务于民创作了一个全新的售后模式，搭建第三方售后服务零距离&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;IT&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;平台，为厂商&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: Calibri;&quot;&gt;,&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;渠道商&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: Calibri;&quot;&gt;,&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;维修商和消费者之间搭建了桥梁。厂家通过驰达联保，服务全国各地。进而提高售后服务慢效率差的问题，提高厂家的销量，从而给师傅带来更多的安装单和维修单。&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Calibri;font-size: 14px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-align: center;&quot;&gt;售后维修商可以在联保平台上接到更多的维修单进而提高收入，也为技工群体创造了创业、就业机会；对消费者而言，有一个第三方管理平台做价格规范，维修师傅行为规范，不仅解决了消费者的担心也为消费者找师傅提供了便利。公司合作的品牌包括苏泊尔、长虹、夏浦，容声、好太太、樱花、明彩、领派、机灵、康佳、飞羽等1000多个，在全国23个省，4个直辖市，5个自治区的市、区、县、乡镇拥有签约售后商9764家；逐渐覆盖全国。&amp;nbsp;公司始终坚持“一切以消费者满意为标准”，以“整合家电售后市场资源，提供创新型售后服务体验与增值服务，让售后服务市场更加规范，让消费者体验更安心、放心、舒心。”为核心经营理念。通过平台系统、机制、等级评比服务等实现个性化客户需求，面向全国，在维修商网络中建立统一的服务体系，并将这种服务体系称之为驰达联保——CDJW（chidajiawei）。具体在售后方面的内容，就是提供更加快捷的上门维护、上门安装、上门维修、商品咨询、投诉受理等服务，让中国的家电售后变成只要在PC电脑端或手机微信端轻松点点就可完成产品安装或维修下单，产品商或消费者下单后将很快得到驰达家维师傅的电话联系，快速为顾客解决所有烦恼的一站式服务。 驰达联保将推出逐步免费服务、实现一码搞定家电产品售后服务，掌上联保等更多服务功能，在为广大消费者提供更便捷服务的同时，不断支持参与行业标准制定及服务行为规范，为产品商解决产品售后难题，为消费者创造一个良好的消费环境；让更多消费者买的放心，“保”的贴心。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;公司定位：面向消费者、维修商、产品商的第三方售后服务IT平台。&lt;br/&gt;公司愿景：成为中国第三方家电售后服务第一品牌，成为中国第一家以售后服务平台运营成功上市的企业。&lt;br/&gt;公司使命：让家电售后真正实现服务零距离！&amp;nbsp;服务理念：平台服务：简单、稳定；客服服务：及时、热情；技师服务：专业、规范；&lt;br/&gt;&lt;span style=&quot;text-align: center;&quot;&gt;企业精神：拼搏、创新、诚信：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;text-align: center;&quot;&gt;&amp;nbsp;注：服务中心网点请在电脑上登录《http://www.lianbao100.com/》如果忘记了请联系客服QQ3421608216&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '关于全国联保', '1467948692', '6', '2');
INSERT INTO `lb_policy` VALUES ('17', '关于驰达家维', '&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 16px&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;尊敬的厂商朋友，欢迎来驰达家维4.0系统,请您按照以下内容操作工单系统；谢谢&lt;img src=&quot;http://localhost/data/upload/ueditor/20160906/57ce7a473ffbc.gif&quot; alt=&quot;&quot; style=&quot;border: 0px;padding: 0px&quot; border=&quot;0&quot;/&gt;；&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 16px&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;br style=&quot;border: 0px;padding: 0px&quot;/&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51);font-size: 14px;line-height: 2.5&quot;&gt;一、&amp;nbsp;开通系统&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;：能进入此界面，说明您的系统已经开通；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51);font-size: 14px;line-height: 2.5&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&amp;nbsp;注&amp;nbsp;【驰达家维所有的工单流通必须经过工单系统，不接受系统外手工单】&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51);font-size: 14px;line-height: 2.5&quot;&gt;二、&amp;nbsp;充值：&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;如余额不足请按照以下两种方式充值；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;1、&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5; border: 0px; padding: 0px; color: rgb(51, 127, 229);&quot;&gt;自助充值&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;：&lt;/span&gt;&lt;strong style=&quot;font-size: 14px; line-height: 2.5; border: 0px; padding: 0px;&quot;&gt;系统支持厂商微信充值，充值立马到账&lt;/strong&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;；直接点击【充值】进行操作&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: start; border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;text-align: center; border: 0px; padding: 0px; font-size: 14px; line-height: 2.5;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;2、&amp;nbsp;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(51, 127, 229)&quot;&gt;人工充值&lt;/span&gt;：直接打入驰达联保公司账号，开户名：&lt;/span&gt;&lt;span style=&quot;text-align: center; font-family: 宋体; font-size: 14px;&quot;&gt;四川驰达家维科技有限公司，开户账号：&lt;/span&gt;&lt;span style=&quot;text-align: center; font-family: 宋体; font-size: 14px;&quot;&gt;7 60104 00117 162282&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 3,&lt;strong&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px; color: rgb(84, 141, 212);&quot;&gt;测试单&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14px; color: rgb(84, 141, 212);&quot;&gt;：&lt;/span&gt;厂家商家可充值30元，测试工单。工单相关内容远程地图图片，配件申请照片，工单完结照片，收件信息，发件信息。 测试充值支付宝：账号:&lt;span style=&quot;font-family: 宋体; font-size: 14px; color: rgb(0, 0, 0);&quot;&gt;15228055428&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;;font-family:宋体;font-size:14px&quot;&gt;&lt;span style=&quot;font-family:宋体&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 127, 229); font-size: 14px; line-height: 2.5;&quot;&gt;充值后联系驰达联保客服QQ：3421608216 &amp;nbsp; &amp;nbsp;&amp;nbsp;244202101&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong style=&quot;font-size: 14px; line-height: 2.5; border: 0px; padding: 0px;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51)&quot;&gt;三、&amp;nbsp;选择成为零门槛客户或保证金客户&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;（详细请见《保证金客户与零门槛客户的区别》）；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 四、&amp;nbsp;购买单量&lt;/span&gt;&lt;/strong&gt;：驰达家维工单分为安装、上门维修、送修三种工单，每种工单常规价格为10元/单，如您单量较大，可以联系QQ一次性购买套餐单量则享有更低价格的优惠；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;color: rgb(229, 51, 51)&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 五、&amp;nbsp;了解驰达家维产品费标准&lt;/span&gt;：点击【价格查看】了解支付给售后商的价格标准，系统制定，全国统一，此价格为保内安装、维修、送修价格，不含：安装中的辅材、额外人工费；保外维修、送修人工及配件费。该费用标准会根据市场情况适当调整，调整前会提前10个工作日通知，具体以系统为准。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px; padding: 0px; font-size: 14px; line-height: 2.5; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;六、&amp;nbsp;发布工单：根据需求发布安装/维修/送修单，注意事项：&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/strong&gt;1、&amp;nbsp;保修类型：厂商付费则选择保修内，消费者付费则选择保修外；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;2、&amp;nbsp;品牌型号：可自行添加；按照驰达家维分类项目下拉选择产品类型，如发现系统没有的分类，可联系驰达家维业务员或客服进行添加；&lt;span style=&quot;padding: 0px; font-size: 14px; line-height: 2.5; background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;3、&amp;nbsp;城市：下拉选择，一定要至少选择到三级分类，否则系统无法匹配当地售后商，如发现系统没有城市的分类，可联系驰达家维业务员或客服进行核实；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;4、&amp;nbsp;详细地址：手动填写；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5; text-align: center;&quot;&gt;5、&amp;nbsp;客户姓名、性别、手机自行填写；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;6、&amp;nbsp;回收时间：驰达家维现只有1300个区县某些品类能保证100%接单（详细请见《驰达家维联保网全国区域网点覆盖表（1588个区县）》），虽然全国还有11000多个售后商能接单，但全国有40000多个乡镇，我司无法保证全国100%接单。故厂商下单时要选择回收时间，驰达家维在回收时间内无法流通工单时，我司会通过系统和短信通知厂商，由厂商及时想办法解决。&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;【周末节假日请将工单回收时间设置为48小时以上】&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5&quot;&gt;备注：安装/维修中的注意事项请厂商下单时必须备注清楚。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 96px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px; line-height: 2.5;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;厂家免费发单时间1年，2016年9月1号实行。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;border: 0px none; margin-top: 0px; margin-bottom: 0px; margin-left: 48px; padding: 0px; font-family: 微软雅黑; font-size: medium; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5;color: rgb(229, 51, 51)&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;&lt;span style=&quot;border: 0px;padding: 0px;font-size: 14px;line-height: 2.5;color: rgb(229, 51, 51)&quot;&gt;&lt;strong style=&quot;border: 0px;padding: 0px&quot;&gt;七、&amp;nbsp;工单跟进（详细请见工单跟踪及工单详情，系统支持催单、留言及客诉）：&lt;/strong&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', null, '1470621473', '8', '2');
INSERT INTO `lb_policy` VALUES ('11', '用户协议', '&lt;p style=&quot;text-align: center;&quot;&gt;普通会员注册协议&lt;br/&gt;&amp;nbsp;&lt;br/&gt;&amp;nbsp; &amp;nbsp;驰达联保在此特别提醒用户认真阅读、充分理解本协议各条款，特别是其中所涉及的各项服务要求的条款。请用户审慎阅读并选择接受或不接受本协议。除非用户接受本协议所有条款，否则会员无权承接本公司所有工单。用户在本网站注册、登录或使用本网站服务，即表示用户完全接受本协议的全部条款，并同意接受其约束。&lt;br/&gt;1.&amp;nbsp;&amp;nbsp;&amp;nbsp;售后商上门服务的工单在厂家发单时起计算2小时以内电话预约消费者上门服务时间、做好故障咨询及故障备件的准备工作，必须按与消费者预约好的时间准时上门服务，保证在24小时内上门检测、安装、维修完成后，获取服务用户的验证码，在手机APP端/微信端、电脑工单系统完结工单，售后商没有上门服务，或是没有完成服务而向用户骗取验证码的，将拉入驰达联保黑名单，终身禁止接单！&lt;br/&gt;&lt;br/&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;因用户不在家导致24小时内无法提供上门服务的，在收到用户答复后的2小时之内，将信息反馈至手机APP/微信端、电脑工单系统。&lt;br/&gt;&lt;br/&gt;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;工单服务无需配件或配件齐全的条件下，服务时间控制在24小时内完成，在手机APP/微信端、电脑工单系统完结工单。&lt;br/&gt;4.&amp;nbsp;售后商在服务的过程中，甩单一次，30天禁止接单，甩单三次以上，终止合作，终生不能接单。甩单的定义：通过电脑/微信平台接单成功后，24小时内不联系用户上门，不告知乙方工单的状态，对工单置之不理。&lt;br/&gt;&lt;br/&gt;5.&amp;nbsp;售后商在服务的过程中,对于保修期内上门维修的产品，在微信/电脑工单平台上结算工费时，必须按照中国联保提供的标准价格来选择（根据维修类别：检测、小修、中修、大修，来严格选择相应的维修工费，如不清楚维修类别，可致电驰达联保18108158113）。如果出现违规操作，扣除工单产生的所有工费，并关闭15天的接单权限。&lt;br/&gt;&lt;br/&gt;6.&amp;nbsp;&amp;nbsp;&amp;nbsp;需从厂商申请配件的，师傅将配件拍照，登记配件型号、规格、编码反馈至微信工单系统，中国联保客服中心将协助会员从厂商订购配件。涉及到通用型且价格较低的配件，售后商可以致电驰达家维客电话（18108158113），申请是否可以在当地自行购买配件，经驰达联保审批后，购买的配件费用与维修工费一并结算给售后商。&lt;br/&gt;&lt;br/&gt;7.&amp;nbsp;&amp;nbsp;&amp;nbsp;厂商快递配件，配件到达后预约用户，以用户要求的时间内提供上门服务，并在服务当日完结工单，不能完结的，将原因及时反馈至工单系统。&lt;br/&gt;&lt;br/&gt;8.&amp;nbsp;&amp;nbsp;&amp;nbsp;更换下来的坏件，根据厂商配件返厂要求，会员将坏件打包，快递返厂（到付）；会员拖延返厂（7天内），或不返厂的，扣除工单产生的所有工费，并停掉15天的接单权限。&lt;br/&gt;&lt;br/&gt;9.&amp;nbsp;&amp;nbsp;&amp;nbsp;保修期外的产品维修需按照《驰达联保包外维修价格标准》严格执行，不得虚报高维修价格，不得虚报高零配件价格，机器出现故障需更换两个以上配件的情况下，只能收取一次维修费用（以最高维修类别为准），如有违规，需退回客户多报费用，并停掉15天的接单权限。（通用型配件，如果市面上可以购买的，师傅可以与用户协商配件价格，经客户同意后，可以购买更换，如果是非通用型配件，建议客户在厂家自行购买配件，师傅只收取维修费）&lt;br/&gt;&lt;br/&gt;10.&amp;nbsp;&amp;nbsp;安装维修需要用到辅助材料的，参照《驰达联保辅助材料价格表》的标准收费，需填写《服务确认单》，收费后向用户开具收费明细的收据。&lt;br/&gt;&lt;br/&gt;11.&amp;nbsp;&amp;nbsp;安装，维修过程中机器需返厂维修或退换机，在邮寄货物前及时联系驰达家维QQ客服，驰达联保技术部与现场师傅确认产品外观情况，并拍照取证，以免在厂商收到货物后发现有物理损坏而产生纠纷！&lt;br/&gt;&lt;br/&gt;12.&amp;nbsp;&amp;nbsp;安装的产品，在安装完成后，一个月内出现与安装有关产品性能故障（如热水器净水器漏水、空调少漏雪种等），售后商需免费再次上门重新安装或维修，不得向消费者收取任何费用。维修的产品，在修复后的三个月内，发生同一故障同部件的重复维修，由会员提供免费保修，需再次更换配件的由厂商提供。&lt;br/&gt;&lt;br/&gt;13.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;售后商上门检测或者未上门通过电话与用户沟通后，反馈给厂商所需配件，厂商发送配件到用户家，上门给客户更换维修。如果因师傅检测失误，导致需求配件错误，厂商需再次寄送，则会员应承担厂商寄错配件的往返物流费用；且售后商不能收取二次上门费。如果是厂商发错配件或者是配件来料不良，而导致多次上门，会员可以收取30元的二次上门费用，发错配件或配件来料不良的往返物流费由厂家承担。&lt;br/&gt;14.&amp;nbsp;&amp;nbsp;售后商在上门安装前，需同用户确认安装环境，是否达到安装条件，避免用户投诉与二次上门。如：即热式热水器功率很大，在上门前与用户确认线路是否乎合安装要求；安装抽油烟机与灶具时，与用户确认是否已开通燃气，抽油烟机的排烟孔是否已开好，或是需要安装师傅来开孔；电视机挂装，特殊墙体（大理石）打孔需加收打孔费用，需向用户说明。&lt;br/&gt;&lt;br/&gt;15.&amp;nbsp;售后商不通过驰达联保私自与厂商联系承接工单，发现一次，禁止1个月的接单权限，发现二次，终止合作关系，请售后商严格遵守！&lt;br/&gt;&lt;br/&gt;16.&amp;nbsp;在售后服务网点签约的范围内，原则上无远程费，对于一些偏远地区，或者不在驰达联保签约厂商服务范围的乡、镇、村，可以申请远程补贴，上门前在微信工单系统向厂商申请远程费，申请原则：15公里内无远程费，超过15公里，按每公里1.5元计算。需经过厂商的确认后才算有效，未经确认私自更改费用的，驰达联保不予结费。&lt;br/&gt;&lt;br/&gt;17.&amp;nbsp;授权会员在服务过程中，必须严格执行驰达联保服务规范，不做有损驰达联保企业形象的事，不得故意诋毁驰达联保签约厂商，不得在消费者面前胡乱点评产品质量或品牌形象的好坏，如果导致用户退货或换货，售后商需承担厂商所有经济损失，并关闭15天的接单权限。&lt;br/&gt;&lt;br/&gt;18.&amp;nbsp;&amp;nbsp;售后商按照我司的售后服务标准开展业务，包括业务模式、流程规范、统一形象的规定，甲方必须按照合同附件《驰达联保售后商服务准则》、《驰达联保售后服务收费标准》、《驰达联保辅材价格标准》执行。&lt;br/&gt;19.&amp;nbsp;&amp;nbsp;我司保留因技术进步、行业调整、消费水平提高或国家政策变动等原因对售后服务价格、服务方式等做出调整的权利，我司提前10天发布公告或告知。采用电话、短信、微信和互联网等方式进行业务公告及业务通知。&lt;br/&gt;20.&amp;nbsp;&amp;nbsp;在售后服务过程中，必须严格执行驰达联保服务规范，不做有损驰达联保企业形象的事，不故意诋毁驰达联保签约厂商及厂商的产品，如果有违规、弄虚作假等行为，驰达联保将按照协议标准，对其进行相应的处罚，直至终止合作协议，追究相应的法律责任。&lt;br/&gt;21.&amp;nbsp;&amp;nbsp;我司接到消费者投诉后将对投诉事由进行审查，确属甲方原因的，甲方应积极配合解决客诉，并承担相应的责任。情节严重损坏中国联保企业形象的将停止工单业务，取消其加盟资格。属于产品本身质量问题的，由我司与产品生产厂家或销售商协商解决。如双方对于是否产品质量问题有争议，经协商可提交第三方检测机构检测，检测费用由持检测结论的责任方承担。&lt;br/&gt;22.&amp;nbsp;售后商在从事高空及特种作业时，必需按照国家特种作业规定持有国家相关部门认证的相应工种高空及特种作业证才可上岗工作，如果提供虚假信息或未按本条款规定上岗而产生任何的安装及维修风险，自行承担所有后果。&lt;br/&gt;23.&amp;nbsp;&amp;nbsp;售后商应当严格按照国家法律法规对售后服务规范的要求，并在能力范围内承接工单。我司对于售后商违规操作引起的任何自有人员或第三方的人身和财产顺势不负有任何责任。&lt;br/&gt;24.&amp;nbsp;&amp;nbsp;双方合作过程中产生的争议应协商解决，不愿协商或协商不成的，可以向我司所在地人民法院起诉。&lt;br/&gt;25.&amp;nbsp;本协议的订立、执行和解释均适用中华人民共和国大陆地区适用之有效法律（但不包括其冲突法则）。如有发生本协议与适用之法律相抵触时，则这些条款将完全按照法律规定重新解释，而其他条款继续有效。&lt;br/&gt;&amp;nbsp;&lt;br/&gt;&lt;br/&gt;成都市驰达家维家电服务公司&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '用户协议用户协议用户协议用户协议', '1467949235', '7', '2');
