INSERT INTO `lb_policy` VALUES ('19', '关于驰达家维', '&lt;pre id=&quot;best-content-653534158&quot; accuse=&quot;aContent&quot; class=&quot;best-text mb-10&quot; style=&quot;margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, arial, &amp;quot;courier new&amp;quot;, courier, 宋体, monospace; white-space: pre-wrap; word-wrap: break-word; line-height: 29px; color: rgb(51, 51, 51); min-height: 55px; background-color: rgb(255, 255, 255);&quot;&gt;　海阔凭鱼跃，天高任鸟飞。每个人都怀揣着一个属于自己的梦想。\r\n　　然而，什么是梦？什么又是梦想？梦是期待，而梦想是坚强--是你把飘渺的梦坚持作为自己理想的勇气和执著，是你对自己负责的最高境界。但扪心自问，我们有多少人能够成就自己心中？\r\n　　我们的梦想，是一个简单的信念，是一份对自己未来与生命的责任。也许，是二十岁的豪情壮志；也许，是青春期的迷茫与冲动；也许只是一份平淡的渴望，渴望掌声，渴望成功。无数的“可能”，无数的“希望”，因为我们的青春岁月充满奇迹，我们心中大大小小的梦，在生活的每一个角落里芬芳弥漫。\r\n　　们，回眸自己的一路成长，还记得每一个梦想带来的悸动，在生命中留下了怎样的足迹么？\r\n　　为了修身养性，母亲让我6岁开始学习书法；因为还没断奶就会说话，母亲又断定了我有语言天赋，从小安排大量的语言训练；又因为母亲年轻时的“作家梦”，我从8岁开始接受正规的写作辅导......就像一块机械的海绵，疯狂的吸收那些陌生的课业知识，外语课、电脑课、家政财经课.....凡是母亲认为应该要学的，那就是我的义务。\r\n　　当一个人看着奖状麻木的时候，我几乎找不到自己的方向；刹那间对于整个未来的失望，在所有人认为你可以成功的时候，我毅然地选择了放弃。\r\n　　高考前的离家出走，为了去寻找所谓能够坚持奋斗的理由。在陌生的城市，徒步行走，在刺眼的阳光中曝露了自己的愚蠢。\r\n　　放弃复读，放弃留在沿海甚至去北京深造的机会，只为了摆脱父母的安排，只为了走自己的路。\r\n　　当一切安顿下来，回想起父母和自己一路颠簸来到这穷乡僻壤；回想起父母离开时，眼里不舍的泪花；回想起恩师们一遍遍劝说我回去复读的短信、电话......我才恍然，我的梦想，付出了如此的代价。\r\n　　当同学对我说，为什么你什么都会的时候。我第一次对母亲充满了感激。那一刻，我才明白，自己一直想要反抗的人，其实是最理解我的人，学会了感激，也学会了正视自己的梦想。\r\n　　是的，我的梦想。一份从一而终的守望--给我的学生希望，给我的读者温暖，给我的爱人幸福。是的，我的梦想。从第一次站上讲台开始迷恋这个地方，从第一次发表文章开始憧憬文字世界，从决定留在这里开始，坚守心底的渴望。\r\n　　无论岁月在我们脸上增添了多少痕迹，无论世事在我们胸口划过多少到伤痕，只要我们还有呼吸的权利，就拥有重塑梦想的激情！只要我们还有生存的氧气，就拥有缔造激情的勇气！\r\n　　落红不是无情物，化作春泥更护花。选择坚持，选择珍惜，选择成就生命的激情，勇敢的成就心中。\r\n\r\n　　每个人都有梦想，它是人人所向往的。没有梦想的人的人生将是空虚的，人生没有梦想就如飞机失去航标，船只失去灯塔，终将被社会所淘汰。但梦想总是随着思想的前进而改变的。碌碌无为是庸人所为，奋发图强是智者之举。\r\n　　童年时，，我希望我有钱。大人问：“小伙子，有了钱你要去干什么呢？”“我要去买泡泡糖”“如果你有很多钱呢？”“我会去买很多泡泡糖”“如果你有用不完的钱呢？”“我会把做泡泡糖的工厂买下来。”的确小时侯的我们，天真无邪，有着一颗善良的童心，幸福与快乐是一曲不变的乐章。\r\n　　慢慢步入小学，中学……就越会觉得压力的存在。现在。我希望每天都不要有很多的要做。玩耍的时间一点点被剥夺，而我们一天中40%被禁锢在教室，很多时间在学习。但是面对学习，还是一种模糊的认识。俗话说“难得糊涂”，对事物的理解，也由发展到资本主义，越大就越觉得自己的观点是对的。\r\n　　上初中的时候，，我希望自己能成为一名尖子生；回到家能受到家人的表扬；在学校能受到老师们的肯定；在同学之间能有鹤立鸡群的表现。但是，渐渐的，我发现实现这个梦想并不能靠要耍耍孩子气。之后，我学会了奋斗。\r\n　　忙忙碌碌一天加上晚自习后放学回家，真是又困又累，吃夜宵都没有味道。这样的日子很单调，也许有时候想念许多小学同学，有时候赶着上课还是一双朦胧的睡眼。讨厌死板的校服装，从不穿着它到处走。星期六、星期天的时间真很短，孩子脾气真想犯，慢慢懂了做人的辛苦和梦想真是太难，还好我会努力，看每一个人都在为了生活而起早赶晚，把握自己不再松散。\r\n　　今天，我有一个梦想，我希望自己能考上一所中意的高中。我为着梦想，`每一天都苦苦寻找着充实自己的辅导书与练习卷，为着光明的未来而努力。\r\n　　梦想像一粒种子，种在“心”的土壤里，尽管它很小，却可以生根开花，假如没有梦想，就像生活在荒凉的戈壁，冷冷清清，没有活力。试问，我们在座的热血青年谁又愿意过那种行尸走肉的日子呢？我相信我不会，你们大家都不会。\r\n　　有了梦想，也就有了追求，有了奋斗的目标，有了梦想，就有了动力。梦想，是一架高贵桥梁，不管最终是否能到达彼岸，拥有梦想，并去追求它，这已经是一种成功，一种荣耀。在追求梦想这个过程中，我们是在成长。\r\n　　它会催人前进，也许在实现梦想的道路中，会遇到无数的挫折和困难，但没关系，跌倒了自己爬起来，为自己的梦想而前进，毕竟前途不仅靠运气，也靠自己创造出来。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', null, '1472635786', '10', '2');
