INSERT INTO `lb_posts` VALUES ('35', '1', '两乘客升舱被拒殴打空乘', '京华时报', '2016-06-14 09:52:20', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">京华时报讯(记者武红利)前天下午，海南航空HU7041自太原飞往重庆。两男性乘客企图免费升头等舱，被制止后辱骂并殴打空乘及空警，致4名空乘及1名空警不同程度受伤。受此影响，飞机晚点两小时。海南航空称，打人乘客被警方带走调查，海航申请将两人列入“旅客黑名单”。太原市机场警方称，案件仍在调查中。</p><table cellspacing=\"0\" cellpadding=\"0\" align=\"left\"><tbody><tr class=\"firstRow\"><td><p><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-5910210021015564\" data-ad-slot=\"3436766932\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 300px; height: 250px;\"><ins id=\"aswift_0_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 300px; background-color: transparent;\"><ins id=\"aswift_0_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 300px; background-color: transparent;\"><iframe width=\"300\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_0\" name=\"aswift_0\" style=\"left: 0px; position: absolute; top: 0px;\"></iframe></ins></ins></ins></p></td></tr></tbody></table><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　两男子占头等舱后不走了</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　据乘客周先生介绍，前天下午，他从太原出发，乘坐海航HU7041航班飞往</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　重庆，他购买的是头等舱机票。飞机原定于下午1点半起飞，1点左右，乘客准时登机。周先生登机后发现头等舱内已经有两名男性乘客，“一个40多岁，一个是个年轻小伙子，说话是山西口音。”</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　随后，空姐在查票时发现两名在头等舱内的男性乘客购买的是经济舱机票。空姐告知两人，升舱需补齐费用，因为机上没有刷卡机器，只能交现金。但两人以现金不够只能刷卡为由拒绝。“他们说自己身上没那么多现金，俩人不交钱也不回经济舱。”周先生说。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　在空姐再次提示两人返回经济舱后，两人情绪激动，出言不逊并殴打空乘。一名在经济舱内的年轻男子曾试图制止两人。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　随后，空乘向机长求助，一名空警前来处置，不料空警也遭到两人的殴打。周先生说，“他们把空警堵在座位上，空警的鼻子都被打流血了。”</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　受此影响，原本已滑行的飞机重新回到原点。机组人员报警后，机场警方到场处置。据了解，两乘客对警方的工作也并不配合。事件造成飞机晚点2小时。周先生称，重新返回飞机上后，他注意到两打人乘客、被打的空乘和空警都没有上飞机。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　辱骂并打伤5名空乘空警</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　昨天下午，海南航空通报称，海南航空高度重视并已成立专项工作组跟踪处理。经调查，6月12日HU7041(太原-重庆)航班，两名经济舱男乘客因无理免费升舱要求被制止，言语辱骂并动手殴打乘务员，造成4名乘务员及1名安全员(空警)不同程度受伤。目前两名打人乘客已被警方带走调查。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　通报称，海航已第一时间安排伤情检查及专人陪护。同时，海南航空对此类行为强烈谴责，并将根据中国民航局及中航协《民航旅客不文明行为记录管理办法》规定，申请将两名涉事乘客列入中国民航&quot;旅客黑名单&quot;，并将坚决依法追究其法律责任。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　昨天下午，太原市机场警方告诉记者，案件仍在进一步审理调查中。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　&gt;&gt;律师</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　涉嫌寻衅滋事罪</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　北京市雄志律师事务所姜健称，本起事件中，两名乘客无合理理由要求免费由经济舱升至头等舱，遭到空乘人员拒绝后，便随意</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 5px 10px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: 微软雅黑; font-size: 15px; line-height: 26px; white-space: normal; background-color: rgb(238, 242, 246);\">　　殴打空乘及空警人员，其行为属于无事生非、肆意挑衅、横行霸道的寻衅滋事。两名乘客存在造成两人以上轻微伤的可能，以及符合公共场所随意殴打他人，造成公共场所秩序混乱的情形，涉嫌构成寻衅滋事罪。构成此罪可处五年以下有期徒刑、拘役或者管制。另外，即便两乘客的行为尚未达到应处于刑罚的情形，但其在飞机上随意殴打他人，造成飞机延误的行为，可依据《治安管理处罚法》，根据情节严重程度，可处以5日以上15日以下的行政拘留，可以并处500至1000元罚款。</p><p><br/></p>', '两乘客升舱被拒殴打空乘 打人者被警方带走调查', '　　京华时报讯(记者武红利)前天下午，海南航空HU7041自太原飞往重庆。两男性乘客企图免费升头等舱，被制止后辱骂并殴打空乘及空警，致4名空乘及1名空警不同程度受伤。受此影响，飞机晚点两小时。海南航空称，打人乘客被警方带走调查，海航申请将两人列入“旅客黑名单”。太原市机场警方称，案件仍在调查中', '1', '1', '2016-06-14 09:50:52', null, '0', null, '', '0', '{\"thumb\":\"\\/data\\/upload\\/20160811\\/57abd0e6055aaFiledata.jpg\"}', '0', '0', '0', '0', '1', '6');
