INSERT INTO `lb_posts` VALUES ('41', '1', '平台优势', '平台优势', '2016-08-17 10:43:33', '<p style=\"text-align: center;\">&nbsp;</p><table cellspacing=\"0\" cellpadding=\"0\" width=\"1119\" style=\"width: 686px;\"><tbody style=\"word-wrap: break-word\"><tr style=\"word-wrap: break-word\" class=\"firstRow\"><td id=\"postmessage_226226\" style=\"word-wrap: break-word;font-size: 14px\"><p style=\"text-align:center\"><a href=\"http://z.jd.com/project/details/20467.html\" target=\"_blank\" style=\"word-wrap: break-word;color: rgb(51, 102, 153)\"><img src=\"http://lianbao.cdth.cn/data/upload/ueditor/20160817/57b3d00491b23.jpg\" height=\"135\" width=\"150\" border=\"0\" style=\"word-wrap: break-word;border: none\"/></a></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px;line-height: 1.5\">如今空调、洗衣机、冰箱这些大件家电几乎已经成为每户家庭的“标配”；豆浆机、电饭煲、榨汁机这些功能多样的小家电也走进了千家万户。但是这些家电一旦过了保修期出现故障，维修点难找、师傅专业性不强、师傅拒绝上门服务……家电维修困难的问题接踵而至。</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">家住湖城天盛花园小区的褚女士也遇到了同样烦恼的问题，“上周，我家买来已有<span style=\"font-family:Calibri;word-wrap: break-word\">3</span><span style=\"font-family:宋体;word-wrap: break-word\">年的豆浆机突然不能加热，因为过了保修期，在外面找了好几家维修点，但是师傅们都不愿修理。”褚女士说，最后还是邻居向她推荐了驰达家维</span></span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">”</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">，才把豆浆机的问题解决了。</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">小家电内部构造比较精致，往往需要维修师傅耗费很多时间寻找症结所在，花费的精力与利润不成正比，因此很多维修师傅都拒绝维修小家电。</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">“驰达家维”</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">专业维修大小家电的</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">师傅拥有二十几年的维修经验，业余时间也非常喜欢研究小家电的各种“疑难杂症”，对家电维修他有自己的理解。“在使用期内，如果家电出现故障的问题不大，建议市民选择维修，而不是立马购置新的家电，这是一种环保意识。</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: Calibri;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\"><strong style=\"word-wrap: break-word\">什么是“驰达家维”？</strong></span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">驰达家维是家电售后服务平台——驰达家维新开发出的一款微信客户端，只需关注即可下单，不管是保内还是保外的家电，只要消费者下单，专业的维修师傅便会预约上门服务。除了家电维修这项服务之外，还包括家电清洗和家电安装等服务，消费者可根据自身需求选择。</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">使用【驰达家维】的五大好处：</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">第一、</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">随时随地下单，不受地域限制</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">第二、</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">解决日常难题，师傅上门迅速</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">第三、</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">符合主流应用，用户体验佳</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">第四、</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">不占手机界面空间，微信应用一体</span></p><p style=\"word-wrap: break-word; text-align: center;\"><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">第五、</span><span style=\"word-wrap: break-word;font-family: 宋体;font-size: 14px\">老少皆宜，童叟无欺，关注一下能咋地</span></p></td></tr></tbody></table><p><br/></p>', '平台优势', '平台优势', '1', '1', '2016-08-17 10:41:21', null, '0', null, '', '0', '{\"thumb\":\"\\/data\\/upload\\/20160817\\/57b3d66736852Filedata.jpg\"}', '0', '0', '0', '0', '1', '6');
INSERT INTO `lb_posts` VALUES ('40', '1', '维修技术培训', '驰达家维', '2016-06-14 10:30:18', '<p>&nbsp;<span style=\"font-size: 20px;\"> &nbsp;<span style=\"font-size: 16px;\">冉广东出生于82年6月7日毕业于山东南翔技工学校，是驰达家维的家电培训讲师,主要负责电视机,广告机,音响,的维修技术培训，定期培训个网点的维修技术。</span></span></p><p><span style=\"font-size: 20px;\"><span style=\"font-size: 16px;\">&nbsp; &nbsp;&nbsp;</span></span></p>', '冉广东', '家电维修', '1', '1', '2016-06-14 10:28:42', null, '0', null, '', '0', '{\"thumb\":\"\\/data\\/upload\\/20160811\\/57abd091de9c3Filedata.jpg\"}', '0', '0', '0', '0', '1', '10');
