INSERT INTO `lb_posts` VALUES ('43', '1', '平台优势', '', '2016-09-05 14:46:03', '<p style=\"text-align: center;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\">驰达家维科技有限公司，坐落于四川省天府新区，是一家专业从事家电售后服务，互联网平台搭建与维护的高科技企业。公司搭建的联保壹佰网，是西部地区首家集家电产品安装、维护和维修于一体的全国性第三方服务平台。驰达家维公司立足于为家电生产商、渠道商、维修师傅和消费者之间搭建的桥梁。</span></p><p style=\"text-align: center;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun; color: rgb(0, 0, 0);\">家电生产销售企业，可以通过联保壹佰网，达到全国售后服务队伍网点覆盖，进而提升售后服务反应速度，促进销量和信誉度提升；售后维修商可以在联保壹佰网，平台上接到更多的维修单进而提高收入；单独的家电维修师傅，也可以通过联保壹佰网进行正规认证，在平台上接到更多的维修订单。这不仅解决的了民生问题，也为技工群体创造了创业、就业机会；对消费者而言，有一个第三方管理平台做价格规范，维修师傅行为规范，不仅解决了消费者的担心，也为消费者找师傅提供了便利。</span></p><p><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">联保壹佰网的服务模式，赢得了康佳、科隆、容声、小天鹅、伊莱克斯、西门子、博世、三星、索尼、LG、美的、万和、华帝、九阳、华帝、方太、樱花、飞利浦、奥克斯、志高、伊莱特、新飞、奥玛、九州等众多中外家电企业的信赖与合作，也使位于各个市县乡镇村庄的消费者，能在最快最短的时间，得到家电售后维修保养服务。</span></p><p><br/></p>', '平台优势', '平台优势', '1', '1', '2016-09-05 14:44:56', null, '0', null, '', '0', '{\"thumb\":\"\\/data\\/upload\\/20160905\\/57cd14d74ea80Filedata.jpg\"}', '0', '0', '0', '0', '1', '3');
INSERT INTO `lb_posts` VALUES ('42', '1', '对公账户', '对公账户', '2016-08-18 09:57:39', '<ul class=\"lemmaWgt-lemmaTitle lemmaWgt-lemmaTitle- list-paddingleft-2\" style=\"margin: 0px 0px 10px; padding: 0px; width: 700px; font-family: arial, tahoma, &#39;Microsoft Yahei&#39;, 宋体, sans-serif; color: rgb(51, 51, 51); font-size: 12px; line-height: 18px; white-space: normal; background-color: rgb(255, 255, 255);\"><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><ul class=\"custom_dash list-paddingleft-1\"><ul class=\"custom_dot list-paddingleft-2\"><ul class=\" list-paddingleft-3\" style=\"list-style-type: circle;\"><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><ul class=\" list-paddingleft-2\" style=\"list-style-type: square;\"><ul class=\"custom_dash list-paddingleft-1\"><ul class=\"custom_dot list-paddingleft-2\"><li class=\"list-dot list-dot-paddingleft\"><h1 style=\"margin: 0px 10px 0px 0px; padding: 0px; font-size: 34px; display: inline; line-height: 1.15; font-weight: 400; vertical-align: sub; text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;对公账户</h1><p style=\"text-align: center;\">&nbsp;</p></li></ul></ul></ul></ul></ul></ul></ul></ul></ul><p style=\"text-align: center;\">公司对公帐户分为四类：基本账户、一般账户、临时账户及专用账户。 其中： 基本账户一个公司只能开一个。 其他的 例如：一般账户，一个公司可以根据业务需要开立多个，没有数量限制。 人民银行的账户管理规定：一个企业只能开立一个基本账户，但是可以开立多个一般账户，如果另处还要开一个可以取款的账户，而且资金方有一定的专门用处，那么你可以在该行申请办理一个专用账户也是可以取款的。</p><p style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; font-weight: 400; text-align: center; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; 基本存款</h2><p style=\"text-align: center;\"><a target=\"_blank\" href=\"http://baike.baidu.com/view/1323974.htm\" style=\"color: rgb(19, 110, 194); text-decoration: none;\">账户</a>。一个企业事业单位只能在一家银行开立一个基本存款账户。存款人的工资、奖金等现金的支取只能通过基本账户办理。<br/></p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub3905519_2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"一般存款\"></a></p><p style=\"text-align: center;\">外的银行营业机构开立的银行结算账户。该账户可以办理转账结算和现金缴存，但不得办理现金支取。<br/></p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub3905519_3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"专用存款\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; font-weight: 400; text-align: center; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">专用存款</h2><p style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; 专项管理和使用而开立的银行结算账户。专用存款账户用于办理各项专用资金的收付，允许支取现金的专用存款账户，须经批准同意。 &nbsp; &nbsp; &nbsp; 基本建设资金、更新改造资金、财政预算外资金、粮、棉、油收购资金、单位银行卡备用金、证券交易结算资金、期货交易保证金、金 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;融机构存放同业资金、 &nbsp; &nbsp; &nbsp; 收入汇缴资金和业务支出资金、党、团、工会设在单位的组织机构经费及其他按规定需要专项管理使用的资金可以申请开立专用存款账户。<br/></p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub3905519_4\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"临时存款账户\"></a></p><h2 class=\"title-text\" style=\"margin: 0px; padding: 0px 8px 0px 18px; font-size: 22px; color: rgb(0, 0, 0); float: left; font-weight: 400; text-align: center; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">临时存款账户</h2><p style=\"text-align: center;\">结算账户。用于办理临时机构以及存款人临时经营活动发生的资金收付。临时存款账户支取现金，应按照国家现金管理的规定办理。开立临时存款账户的范围：设立临时机构、异地临时经营活动、注册验资。<br/></p><p><br/></p>', '对公账户', '对公账户', '1', '1', '2016-08-18 09:53:05', null, '0', null, '', '0', '{\"thumb\":\"\\/data\\/upload\\/20160818\\/57b5151a6d64bFiledata.jpg\"}', '0', '0', '0', '0', '1', '11');
