INSERT INTO `lb_posts` VALUES ('45', '1', '操作流程', '', '2016-09-10 21:09:46', '<p><span style=\"color: rgb(0, 0, 0);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color: rgb(0, 0, 0); font-size: 24px;\">驰达家维电脑端发单操作和说明</span></span></p><p><span style=\"font-size: 20px;\">打开驰达联保网址</span><a href=\"http://www.lianbao100.com/，注册我的账号。《输入手机号注册》，登录我的账号。\" _src=\"http://www.lianbao100.com/，注册我的账号。《输入手机号注册》，登录我的账号。\" style=\"font-size: 20px; text-decoration: underline;\"><span style=\"font-size: 20px;\">www.lianbao100.com/，注册我的账号。《输入手机号注册》，登录我的账号。</span></a> </p><p><span style=\"font-size: 20px;\">1，登录我的账号进入系统，点击下单必读，查看驰达联保系统流程。</span></p><p><span style=\"font-size: 20px;\">2，价格查看，点击价格查看，查询产品安/维修单价。</span></p><p><span style=\"font-size: 20px;\">3，点击发单产品《1,点击品牌列表 2,在点击添加产品 3,输入产品品牌点击确定》</span></p><p><span style=\"font-size: 20px;\">，《1点击产列表 2,点击添加产品 3,输入产品名称及规格型号 4,选择品牌/品类 确认》</span></p><p><span style=\"font-size: 20px;\">产品添加完成。</span></p><p><span style=\"font-size: 20px;\">4，点击购买单量，分别有安装单,维修单和送修单，输入购买的单量确任购买。</span></p><p><span style=\"font-size: 20px;\">5，发布工单 选择《安装单/维修单/送修单》选择产品，选择城市，输入详细地址</span></p><p><span style=\"font-size: 20px;\">用户信息，下拉选择保内，保外单 描述相关内容确认提交。</span></p><p><span style=\"font-size: 20px;\">6，工单查看，分别有所有工单,待接单,已取消单,已完结单,远程单,配件单，投诉单,待支付单。</span></p><p><span style=\"font-size: 20px;\">7，远程单，可以查看师傅到用户家的地图距离，同意或拒绝。</span></p><p><span style=\"font-size: 20px;\">8，配件单，可以查看师傅发来需要的配件照片和收件信息。同意或拒绝。</span></p><p><span style=\"font-size: 20px;\">9，系统可以查看所有消费信息。</span></p><p><span style=\"font-size: 20px;\">10，我们的系统是自动派单，1分钟发单。<br/></span></p><p><span style=\"font-size: 20px;\">注：厂家朋友们如有不懂的请联系客服：QQ&nbsp;244202101 &nbsp;QQ 3421608216</span></p>', '厂家电脑端发单', '系统流程', '1', '1', '2016-09-10 21:00:40', null, '0', null, '', '0', '{\"thumb\":\"\"}', '0', '0', '0', '0', '1', '5');
