INSERT INTO `lb_posts` VALUES ('54', '1', '网点覆盖', '网点覆盖', '2016-09-12 16:19:56', '<h2 style=\"margin: 0px; padding: 0px; list-style: none; font-family: &quot;Microsoft yahei&quot;; font-weight: normal; color: rgb(102, 102, 102); text-align: left; white-space: normal;\"><span style=\"color: rgb(0, 0, 0);\"><strong><span style=\"font-family: 宋体, SimSun;\"></span></strong></span></h2><h2 style=\"margin: 0px; padding: 0px; list-style: none; font-family: &quot;Microsoft yahei&quot;; font-weight: normal;\"><span style=\"font-size: 24px; color: rgb(0, 0, 0);\">驰达联保全国区域网点覆盖表</span></h2><p><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; font-size: 13.3333px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 16px; color: rgb(0, 0, 0);\">&nbsp; &nbsp; &nbsp; 1.本数据来自驰达联保网数据库：30省，1681区县</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; font-size: 13.3333px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 16px; line-height: 1.5; color: rgb(0, 0, 0);\">2.驰达联保全国客户服务QQ3421608216 &nbsp;244202101</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; font-size: 13.3333px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; font-size: 16px; line-height: 1.5; color: rgb(0, 0, 0);\">3.以下数据不包含国家行政划分的乡、镇 &nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); margin: 0px; padding: 0px; list-style: none; font-size: 16px;\">&nbsp; 4.</span><span style=\"margin: 0px; padding: 0px; list-style: none; color: rgb(229, 102, 0); font-size: 16px;\">县级以上服务品类涵盖</span><span style=\"color: rgb(0, 0, 0); margin: 0px; padding: 0px; list-style: none; font-size: 16px;\">：黑电类：电视、家庭影院、音响。空调类：空调、空气能热水器。冰洗类:冰箱、冷柜、酒柜、压缩机除湿机、波轮洗衣机、滚筒洗衣机、脱水机。厨电类：吸油烟机、消毒柜、灶具、集成灶、气电灶、洗碗机、净水器。热水器类： 燃气热水器、储水式电热水器、即热式热水器 、燃气壁挂炉、自动电热水